  return (
    <div className="home-page">
      <Navbar />
      <main>
        <h1>Welcome to Our E-Learning Platform</h1>
        <CourseList courses={[]} /> {/* Pass your courses array here */}
      </main>
      <Footer />
    </div>
  );
}

export default HomePage;
